dium temperature commercial refrigerators; and (2) through-the-wall central air conditioners, through-the-wall central air conditioning heat pumps, and small duct, high velocity systems. Requires the Secretary to: (1) provide notice on whether energy efficiency standards for specified commercial heating and cooling equipment will be amended every six years, (2) evaluate each class of such equipment, (3) provide notice of a decision to grant or deny a petition to amend energy conservation standards, and (4) publish a rule that contains new or amended energy conservation standards every three years.", 
